import axios from "axios"

const API_KEY = "be9334182323977661b71c188c8c2a6e"
const URL = "https://api.openweathermap.org/data/2.5/weather"


export const get = (query) => {
    let { data } = axios.get(URL, {
        params: {
            q: "query",
            units: "metric",
            APPID: "API_KEY"

        }
    })
    return data

}
